dsten Probleme unserer Zeit gebündelt zu präsentieren.</em></p>\n<p><em>Stell dir vor, diese Lösungen können mit Hilfe von Petitionen und der nötigen Anzahl Unterzeichner*innen vor Ort direkt in den Bundestag eingebracht werden.</em></p>\n<p><em><strong>Diese Utopie kann Wirklichkeit werden. Kommt am 12.06.2020 ins Olympiastadion!</strong></em></p>\n</div>\n</div>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', NULL, '', '', '', '', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', NULL, NULL, NULL, '', NULL, NULL, '', '', '', '', '', 0, '');
