rant[-]wortung ebenso bewusst werden und Ursachen erkennen und bekämpfen. Beispielsweise mit <strong>durchdachter Konzeption, nachhaltigem Design und smarter Entwicklung von energieeffizienten Webseiten</strong>.</p>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', NULL, '', '', '', '', NULL, 'ce_cthemes_teaserbox_zeroone', 'mehr über nachhaltiges Handeln erfahren', 'mehr erfahren', '{{news_url::10}}', '', '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', NULL, NULL, NULL, '', NULL, NULL, '', '', '', '', '', 0, '');
