ße der Webseite und andererseits erfordert dessen Verarbeitung mehr Ressourcen auf dem Endgerät des Benutzers. Dies erhöht die CPU-Auslastung, was wiederum den Energieverbrauch des Geräts erhöht. Deshalb macht es Sinn sich zu fragen, ob die gewünschte Interaktion, Funktionalität oder Animation vielleicht auch mit <strong>effizienteren Technologien, wie CSS</strong>, realisierbar wäre.</p>\n<p>Ähnlich verhält es sich mit Webfonts, denn diese wirken sich ebenfalls oft negativ auf die Dateigröße der Webseite aus. Wer Daten, Ladezeiten und Energie sparen will, sollte <strong>Systemschriften </strong>in Betracht ziehen. Wir meinen jedoch nicht Arial oder Times New Roman - die Rede ist von Schriften, die Hausherren ihrer Betriebssysteme sind und <strong>für moderne, hochauflösende Bildschirme konzipiert</strong> wurden: Apple, Google [&] Microsoft haben mit ihren Systemschriften San Francisco, Roboto [&] Segoe <strong>performante, schöne und wirkungsvolle Fonts </strong>geliefert, welche auf Webseiten (wie dieser hier) einen guten Job machen.</p>\n</div>\n</div>', '', '', 0xea6c6e02313011eaa261e0d55edd9ad9, '', '', 'a:3:{i:0;s:3:\"354\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:2:\"50\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:2:\"px\";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:4:\"code\";}', '', '', '', NULL, '', '', '', '', NULL, '', NULL, 'mehr erfahren', '{{link_url::10}}', '', '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', NULL, NULL, NULL, '', NULL, NULL, '', '', '', '', '', 0, '');
