rmance steigt auch gleichzeitig die Usability, denn Nutzer finden schnell das was sie suchen. Hierzu gehört auch effizientes Copywriting, welches Informationen klar und verständlich präsentiert. Zudem sollte der Einsatz von ressourcenintensiven Inhalts-Formaten, wie Videos und Bildern kritisch hinterfragt werden: Bringt das Medium wirklich einen Mehrwert für den Nutzer?</p>\n<p><strong>Somit wird die Nutzung des Webs einfacher und effizienter für alle: der Nutzer spart Zeit, der Anbieter Datenmüll und der Planet profitiert von der eingesparten Energie.</strong></p>', '1', '', 0xea6c6e02313011eaa261e0d55edd9ad9, '', '', 'a:3:{i:0;s:3:\"130\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:3:\"100\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:1:\"0\";s:4:\"unit\";s:2:\"px\";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:4:\"info\";}', '', '', '', NULL, '', '', '', '', NULL, '', NULL, 'mehr erfahren', '{{link_url::10}}', '', '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', NULL, NULL, NULL, '', NULL, NULL, '', '', '', '', '', 0, '');
