sorientiert verfasst. Energieeffizientes Webdesign ist <strong>nutzerfreundlich</strong>, da es seine Zielgruppe kennt. Es verfügt über klare Strukturen sowie kurze Wege und macht deshalb Spaß. Energieeffizientes Webdesign ist <strong>suchmaschinenoptimiert</strong>, weil es sowohl der Suchmaschine als auch dem Nutzer hilft, die gesuchten Informationen schnellstmöglich zu finden.</p>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', NULL, '', '', '', '', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', NULL, NULL, NULL, '', NULL, NULL, '', '', '', '', '', 0, '');
