weile auch bei einer Vielzahl an Hostern möglich. Das allein reicht zwar sicher nicht aus, um das online entstandene CO₂ zu kompen[-]sieren, aber es sorgt zumindest für Schadensbegrenzung.</p>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', NULL, '', '', '', '', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', NULL, NULL, NULL, 'column col-6 col-sm-12', NULL, NULL, '', '', '', '', '', 0, '');
