e wie nötig verwendet. Der Einsatz von ressourcenintensiven Formaten, wie Videos und Bildern wird kritisch hinterfragt und Texte sind knapp und informationsorientiert verfasst. Energieeffizientes Webdesign ist <strong>nutzerfreundlich</strong>, da es seine Zielgruppe kennt. Es verfügt über klare Strukturen sowie kurze Wege und macht deshalb Spaß.</p>\n</div>\n</div>\n</div>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', NULL, '', '', '', '', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', NULL, NULL, NULL, 'column col-sm-12 col-3 col-lg-6', NULL, NULL, '', '', '', '', '', 0, '');
