s und Bildern wird kritisch hinterfragt und Texte sind knapp und informationsorientiert verfasst. Energieeffizientes Webdesign ist <strong>nutzerfreundlich</strong>, da es seine Zielgruppe kennt. Es verfügt über klare Strukturen sowie kurze Wege und macht deshalb Spaß. Energieeffizientes Webdesign ist <strong>suchmaschinenoptimiert</strong>, weil es sowohl der Suchmaschine als auch dem Nutzer hilft, die gesuchten Informationen schnellstmöglich zu finden.</p>', '1', '1', 0xd7a02851306911eaa261e0d55edd9ad9, 'Ursachenbekämpfung', 'Mehr erfahren über Ursachenbekämpfung', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'below', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:11:\"image-right\";}', '', '', '', NULL, '', '', '', '', NULL, 'ce_cthemes_teaserbox_zeroone', 'Mehr erfahren über Ursachenbekämpfung', 'mehr erfahren', '{{link_url::10}}', '', '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', NULL, NULL, NULL, '', NULL, NULL, '', '', '', '', '', 0, '');
