en Energieverbrauch. Es gibt viele gute Online-Tools, um Bilddateien ohne sichtbaren Qualitätsverlust zu komprimieren und in ein effizientes Dateiformat, z.B. WebP, zu konvertieren. Außerdem helfen responsive Image Elemente wie picture und srcset um für jedes Endgerät die passende Bildgröße auszuliefern.</div>\n<div class=\"ce_text  block\"><strong>Dunkle Webseiten</strong> waren eine der ersten Techniken, die vor vielen Jahren zum online Energiesparen populär wurden. Sie verschwanden jedoch mit dem Aufkommen von LCD-Bildschirmen. Mit neuen OLED-Bildschirmen, die wieder jedes Pixel einzeln beleuchten, ist dies jedoch wieder eine praktikable Technik, um den Energieverbrauch auf Endgeräten zu reduzieren. Heute zieht der Dark Mode in immer mehr Apps und Geräte als Standard Feature zum Energiesparen (wie auch in dieser Website) ein.</div>', '', '', 0xea6c6e02313011eaa261e0d55edd9ad9, '', '', 'a:3:{i:0;s:3:\"354\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:3:\"100\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:2:\"px\";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:8:\"material\";}', '', '', '', NULL, '', '', '', '', NULL, '', NULL, 'mehr erfahren', '{{link_url::10}}', '', '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', NULL, NULL, NULL, '', NULL, NULL, '', '', '', '', '', 0, '');
