INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `code`, `url`, `target`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `vimeo`, `posterSRC`, `playerSize`, `autoplay`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `invisible`, `start`, `stop`, `ct_sliderElement_playerSRC`, `ct_sliderElement_subHeadline`, `ct_sliderElement_target`, `ct_sliderElement_linkText`, `ct_sliderElement_page`, `ct_wrapper_name`, `ct_teaserBox_customTpl`, `ct_teaserBox_pageTitle`, `ct_teaserBox_pageText`, `ct_teaserBox_page`, `ct_priceBox_customTpl`, `ct_popularPriceBox`, `ct_priceBox_linkText2`, `ct_priceBox_link2`, `ct_priceBox_linkText1`, `ct_priceBox_link1`, `ct_priceLabel`, `ct_price`, `ct_featureElement_customTpl`, `ct_iconLink`, `ct_featureIcon`, `ct_contentBox_customTpl`, `ct_contentBox_pageTitle`, `ct_contentBox_pageText`, `ct_contentBox_page`, `advancedCss`, `tabs_element`, `tabs_navigation`, `com_template`, `com_requireLogin`, `com_disableCaptcha`, `com_bbcode`, `com_moderate`, `com_perPage`, `com_order`) VALUES(306, 1, 'tl_calendar_events', 160, 1579777555, 'text', 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}', '<p>Die Versammlung im Olympiastadion Berlin wird der globale Startschuss für diese Perspektive sein. Bis zu 90.000 Menschen vor Ort und noch viele mehr über verschiedene Live-Übertragungen werden diesem einzigartigen Event beiwohnen. Wir werden danach mit dem Guten Gefühl nach Hause gehen, einen weiteren Schritt in Richtung Veränderung unternommen zu haben.</p>\n<p>Das Programm an diesem Tag gliedert sich grob in 2 Teile:<br>Der erste Teil dient der Inspiration und der emotionalen Aufladung. Als Inspiration für die Lösungen der Weltprobleme werden bekannte als auch unbekannte Aktivist*innen und Wissenschaftler*innen auf der großen Bühnen ihre Lösungen aus allen wichtigen Arbeits- und Forschungsfeldern vorstellen. Wir wollen diese Menschen feiern, wie wir ansonsten nur Rockstars feiern.</p>\n<p>Der zweite Teil steht ganz im Zeichen der Aktivierung. Ziel ist es, allen Teilnehmer*innen das Gefühl zu geben, dass sie auch als Einzelpersonen Veränderungen bewirken können und diesen Eindruck in ihr persönliches Umfeld, ihre Stadt, ihre Initiative mitnehmen und sich dort weiter engagieren.</p>\n<p>Unser Ziel ist, mit dem 12. Juni 2020 ein Zeichen zu setzen – für unsere Demokratie –<br>und uns daran zu erinnern, wie viel Einfluss von uns als Menschen ausgeht. Wir werden deshalb als konkrete Maßnahme live im Stadion mehrere Petitionen zum Quorum führen und im Bundestag einreichen.</p>\n<p>50.000 Stimmen braucht eine Petition dafür. Wir werden mit bis zu 90.000 Menschen im Olympiastadion sitzen (und unzählige Menschen beim kostenlosen livestreaming zu Hause oder beim Public Viewing) während der Petitionszähler live auf der Leinwand übertragen wird. Die Inhalte, das Programm, die Petitionen sowie ein Starterpaket für die Teilnehmer*nnen (ein Aktivist*innen-Rucksack) werden wir mit euch zusammen und unseren Partnern in den kommenden Monaten erarbeiten. Wir werden von Fridays for Future Berlin und den Scientists for Future beraten. Während all dieser Prozesse werden wir mit euch als Community nicht nur in Kontakt stehen, sondern euch auch einbinden, wenn ihr nicht nur an der Versammlung teilnehmen, sondern auch dazu beitragen wollt.</p>\n<p>Bist du dabei?</p>\n<p>(<a href=\"https://www.startnext.com/12062020\">https://www.startnext.com/12062020</a>)</p>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', NULL, '', '', '', '', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', NULL, NULL, NULL, '', NULL, NULL, 'com_default', '', '', '', '', 0, 'ascending');
